    "2015-01-22T15:57:25.919369",nt"name": "cdbg-expenditure-reports",nt"isopen":
    false,nt"url": null,nt"notes": "These are profiles that show how each entitlement
    community expended CDBG funds during its most recently completed program year. These
    profiles provide information on grantee expenditures by the type of activity carried
    out. Since CDBG funds may be used for a wide variety of housing, community and economic
    development activities, the use of those funds may be identified in these profiles
    by as many as 90 different categories (matrix codes) depending on how an entitlement
    community has chosen to use its funds to meet local needs. With these profiles,
    you can quickly and easily become more informed on how CDBG funds are being spent
    by any one of the entitlement grantees to which funds are awarded or at the national
    level.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
